import React, { useState } from 'react';

 import { Container, Wrapper } from './styles';
 import {Input} from "../../components/Input"
import Header from '../../components/Header';
import { Select } from '../../components/Select';

const CreatePet: React.FC = () => {


  return (
    <>
    <Header></Header>
    <Wrapper> 
      <Container>
          <form>    
          <Input
                noMargin={false}
                onChange={() => null}
                label="Name"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Specie"
            />
             <Select

                noMargin={false}
                onChange={() => null}
                label="Age"

            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Gender"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Link of Image"
            />
             <Input
                noMargin={false}
                onChange={() => null}
                label="Description"
            />
          </form>
          </Container>
      </Wrapper>
      </>

  );
}

export default CreatePet;
